package org.muzir.codechef.practice.beginner;

import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertEquals;

public class SEGM01Test {
	@Test
	public void initialCases() {
		assertEquals(SEGM01.YES, SEGM01.checkOneSegment("001111110"));
		assertEquals(SEGM01.NO, SEGM01.checkOneSegment("00110011"));
		assertEquals(SEGM01.NO, SEGM01.checkOneSegment("000"));
		assertEquals(SEGM01.YES, SEGM01.checkOneSegment("1111"));
		assertEquals(SEGM01.NO, SEGM01.checkOneSegment("101010101"));
		assertEquals(SEGM01.NO, SEGM01.checkOneSegment("101111111111"));
	}

	@Test
	public void cornerCases() {
		assertEquals(SEGM01.NO, SEGM01.checkOneSegment("0011111101"));
		assertEquals(SEGM01.YES, SEGM01.checkOneSegment(""));
		assertEquals(SEGM01.YES, SEGM01.checkOneSegment(""));
		assertEquals(SEGM01.NO, SEGM01.checkOneSegment(""));
		assertEquals(SEGM01.NO, SEGM01.checkOneSegment("000"));
	}
}
